import { Component, OnInit, ViewChild, ElementRef } from '@angular/core';
import html2canvas from 'html2canvas';
import { saveAs } from 'file-saver';
@Component({
  selector: 'app-vcard',
  templateUrl: './vcard.component.html',
  styleUrls: ['./vcard.component.css']
})
export class VcardComponent implements OnInit {
  qr_data: string = '';
  organisations: any;
  names: any;
  phones: any;
  email: any;
  url: any;
  url2: any;
  bg_new: any = "./assets/indus.png"
  bg_img: any = 'data:image/jpeg;base64,';



  constructor() {


  }

  ngOnInit() {

    let name = "Shahanaz Khadeeja",
      organisation = "INDUS Real Estate",
      phone = "0123456789",
      email = 'janedoe@gmail.com',
      url = 'https://www.indusre.com/',
      url2 = 'https://www.indusre.com/indus-real-estate-agent-paresh-chaturvedi-a-2.html',
      Birthday = '12-12-1990',
      pic = '';


    this.qr_data = `BEGIN:VCARD
VERSION:3.0
N:${name}
ORG:${organisation}
TEL;TYPE=voice,work:${phone}
EMAIL:${email}
URL:${url}
URL:${url2}
BDAY:${Birthday}
PHOTO;ENCODING=b;TYPE=JPEG:data:image/jpeg;base64,
ADR;TYPE=intl,work: Almas Tower - Office 4H, 4th Floor - Cluster G - Dubai
END:VCARD
`

    this.names = name;
    this.organisations = organisation;
    this.phones = phone;
    this.email = email;
    this.url = url;
    this.url2 = url2;


  }

  clickMe() {
    let container = document.getElementById('capture'); // full page \
    if (container) {
      html2canvas(container).then(function (canvas) {

        var link = document.createElement("a");
        document.body.appendChild(link);
        link.download = "html_image.png";
        link.href = canvas.toDataURL("image/png");
        link.target = '_blank';
        link.click();
      });
    }



  }

}
